import React, {Component} from 'react';
import {
    Navbar,
    Input,
    Button,
    InputGroup,
    InputGroupAddon,
    Container,
    Col,
    Form
} from 'reactstrap';
import { MdSearch} from 'react-icons/md'
class Home extends Component {
    sltaker = (evento) =>{


    }
    render() {
        return (
            <>
                <Navbar color="dark" fixed="bottom">
                    <Container className="d-flex justify-content-center">
                        <Col xs="12" md="6">
                            <Form>
                                <InputGroup>
                                    <Input />
                                    <InputGroupAddon addonType="append">
                                        <Button color="danger">
                                        <MdSearch size="20" />
                                        </Button>            
                                    </InputGroupAddon>
                                </InputGroup> 
                            </Form>
                        </Col>
                    </Container>
                </Navbar>
            </>
        )
    }
}
export default Home;
